INSERT INTO `master_informasi` (`ID`, `JUDUL`, `DESKRIPSI`, `KATEGORI`, `TANGGAL`, `created_at`, `updated_at`) VALUES
(3, 'Pengumuman Jadwal Ujian Akhir Semester Ganjil', 'Diberitahukan kepada seluruh siswa bahwa pelaksanaan UAS Ganjil akan dimulai pada tanggal 1-10 Desember 2025. Harap persiapkan kartu ujian dan hadir 15 menit sebelum dimulai.', 'Akademik', '2025-11-20', '2025-12-23 07:29:34', '2025-12-23 07:29:34'),
(4, 'Juara 1 Lomba Karya Tulis Ilmiah Nasional', 'Selamat kepada Tim Robotik Sekolah yang berhasil meraih Juara 1 dalam ajang LKTI Nasional di Universitas Indonesia. Prestasi ini membanggakan nama sekolah di kancah nasional.', 'Prestasi', '2025-11-15', '2025-12-23 07:29:34', '2025-12-23 07:29:34'),
(5, 'Pembukaan Pendaftaran Ekstrakurikuler Baru: Coding Club', 'Bagi siswa yang berminat dalam dunia teknologi, sekolah membuka ekskul baru yaitu Coding Club. Pendaftaran dibuka melalui wali kelas masing-masing mulai Senin depan.', 'Ekstrakurikuler', '2025-11-18', '2025-12-23 07:29:34', '2025-12-23 07:29:34'),
(6, 'Rapat Koordinasi Orang Tua Murid Kelas XII', 'Undangan untuk orang tua/wali murid kelas XII terkait pembahasan persiapan ujian nasional dan jalur masuk perguruan tinggi (SNBP/SNBT).', 'Umum', '2025-11-25', '2025-12-23 07:29:34', '2025-12-23 07:29:34'),
(7, 'Beasiswa Berprestasi Tahun Ajaran 2025/2026', 'Pemerintah kota membuka kuota beasiswa bagi siswa yang memiliki nilai rata-rata raport di atas 85. Silakan kumpulkan berkas administrasi di bagian Tata Usaha.', 'Akademik', '2025-11-10', '2025-12-23 07:29:34', '2025-12-23 07:29:34');
